import React, {Component} from 'react';
import './App.css';
import UserInput from "./UserInput";
import UserOutput from "./UserOutput";


class App extends Component {
  state = {
    paragraphs: [
      {para1: 'Doing my first ever assignment in ReactJs'},
      {para2: 'I intend to do it without help as much as possible'}
    ]
  };


  render() {
    return (
        <div className="App">
          <h1>Assignment 1</h1>
          <UserOutput />
        </div>
    );
  }
}

export default App;
